                    </div>
                    <div className=' shadow-lg shadow-grey-800 p-5'>
                        <img className="w-[300px]" src="https://www.logo.wine/a/logo/Instagram/Instagram-Wordmark-Logo.wine.svg" alt="" />
                        <div className='mb-5'>
